import React from 'react';
import Timeline from 'react-visjs-timeline';

const options = {
    width: '100%',
    height: '60px',
    stack: false,
    showMajorLabels: true,
    showCurrentTime: true,
    zoomMin: 1000000,
    type: 'background',
    format: {
      minorLabels: {
        minute: 'h:mma',
        hour: 'ha'
      }
    }
  };

const CustomTimeline = () => {
    return (
    <>
        <Timeline options={options}/>
    </>
    )
};

export default CustomTimeline;
